import { Tabs, Tab, Grid, Typography, Container, Box, Card, CardMedia, CardContent, Divider } from '@material-ui/core'

import useStyles from "../../styles";
import participants from "../../data/Participants";

function UserProfile ({ children, value, index }) {
    const classes = useStyles();
    return (
        <Box sx={{  bgcolor: 'background.paper' }}>
        <Card className={classes.card}>
            <CardMedia 
                height="30"
                className = {classes.cardMedia}
                image={require('../../data/participant_profiles/'+String(children)+'.jpg')} 
                title="Image title"
            />
            <CardContent className={classes.cardContent}>
                <Typography variant="h5">
                    {children}
                </Typography>
                <Typography>
                </Typography>
            </CardContent>
        </Card>
        </Box>
    );
}

export default UserProfile;
